DROP DATABASE IF EXISTS bikes;
CREATE DATABASE bikes;

USE bikes;

CREATE TABLE thefts (
  Xcoord DECIMAL(18, 16),
  Ycoord DECIMAL(18, 16),
  Index_ INT AUTO_INCREMENT PRIMARY KEY,
  event_unique_id VARCHAR(15),
  Primary_Offence VARCHAR(255),
  Occurrence_Date DATETIME,
  Occurrence_Year YEAR(4),
  Occurrence_Month INT(2),
  Occurrence_Day INT(2),
  Occurrence_Time DATETIME,
  Division INT(3),
  City VARCHAR(255),
  Location_Type VARCHAR(255),
  premisetype VARCHAR(255),
  Bike_Make VARCHAR(255),
  Bike_Model VARCHAR(255),
  Bike_Type VARCHAR(255),
  Bike_Speed VARCHAR(255),
  Bike_Colour VARCHAR(255),
  Cost_of_Bike DECIMAL(7, 2),
  Status VARCHAR(255),
  Hood_ID INT(3),
  Neighbourhood VARCHAR(255),
  Latitude DECIMAL(18, 16),
  Longitude DECIMAL(18, 16),
  ObjectId INT(6)
);

